  `,paraId:0},{value:"\u56FE\u89E3",paraId:0},{value:"\u601D\u8DEF",paraId:181,tocIndex:40},{value:"\u6B64\u9898\u53EA\u5141\u8BB8\u539F\u5730\u4FEE\u6539\uFF0C\u4E14\u7ED3\u679C\u6709\u5E8F\uFF0C\u6240\u4EE5\u4F18\u5148\u60F3\u5230\u4E2D\u5E8F\u904D\u5386\u7684\u65B9\u6CD5",paraId:181,tocIndex:40},{value:"\u8981\u8D2D\u6784\u9020\u53CC\u5411\u94FE\u8868\uFF0C\u5C31\u8981\u5BF9\u4E24\u4E2A\u8282\u70B9\u8FDB\u884C\u4E92\u76F8\u5F15\u7528",paraId:181,tocIndex:40},{value:"\u6240\u4EE5\u904D\u5386\u8FC7\u7A0B\u4E2D\u9700\u8981\u4F7F\u7528",paraId:181,tocIndex:40},{value:"pre",paraId:181,tocIndex:40},{value:"\u4FDD\u5B58\u524D\u4E00\u4E2A\u8282\u70B9\uFF0C\u7136\u540E\u66F4\u6539left\u548Cright\uFF0C\u4FDD\u6301pre\u548C\u5F53\u524D\u8282\u70B9\u4E92\u76F8\u5F15\u7528",paraId:181,tocIndex:40},{value:"\u7ED3\u679C\u9700\u8981\u53CC\u5411\u94FE\u8868\u7684head\u548Ctail\u4E5F\u76F8\u4E92\u5F15\u7528\uFF0C\u6240\u4EE5\uFF0C\u904D\u5386\u8FC7\u7A0B\u4E2D\u8981\u4FDD\u5B58head\u8282\u70B9",paraId:181,tocIndex:40},{value:"tail\u8282\u70B9\u5728\u904D\u5386\u7ED3\u675F\u65F6\uFF0Cpre\u5C31\u662Ftail\u8282\u70B9",paraId:181,tocIndex:40},{value:"\u6700\u540E\u66F4\u6539\u5934\u5C3E\u8282\u70B9\u7684left\u548Cright\uFF0C\u4E92\u76F8\u5F15\u7528\uFF0C\u8FD4\u56DEhead\u5373\u53EF",paraId:181,tocIndex:40},{value:"\u8DDF",paraId:181,tocIndex:40},{value:"426\u9898",paraId:181,tocIndex:40},{value:"\u76F8\u4F3C",paraId:181,tocIndex:40},{value:`/**
 * @param {Node} root
 * @return {Node}
 */
var treeToDoublyList = function (root) {
    if (root === null) return null;
    let head = null, pre = null;
    const dfs = (root) => {
        if (root === null) return;
        // --\u524D\u5E8F\u4F4D\u7F6E--
        dfs(root.left);
        // --\u4E2D\u5E8F\u4F4D\u7F6E--
        if (pre === null) {
            // \u5982\u679Cpre\u5728\u4E2D\u5E8F\u904D\u5386\u4E3Anull\uFF0C\u8BF4\u660E\uFF0C\u8D70\u5230\u4E86\u6700\u5DE6\u8FB9
            // \u4E5F\u5C31\u662F\u8D70\u5230\u4E86\u5934
            head = root;
        } else {
            // \u56DE\u9000\u65F6
            // pre\u4E3A1\u8282\u70B9
            // root\u4E3A2\u8282\u70B9
            // 1.right \u6307\u54112
            // 2.left \u6307\u54111
            // \u6784\u5EFA\u53CC\u5411\u94FE\u8868
            pre.right = root;
            root.left = pre;
        }
        pre = root;
        // --\u540E\u5E8F\u4F4D\u7F6E--
        dfs(root.right);
    }

    dfs(root);
    // \u5934\u5C3E\u4E92\u6307\uFF0C\u6784\u6210\u4E00\u4E2A\u66F4\u5927\u7684\u53CC\u5411\u8138\u90E8
    head.left = pre;
    pre.right = head;

    return head;
};
