\u7A7A\u95F4\u590D\u6742\u5EA6O(1)`,paraId:194,tocIndex:43},{value:"\u601D\u8DEF",paraId:195,tocIndex:43},{value:"\u9996\u5148\u4E0D\u80FD\u51FA\u73B0\u96640\u5916 \u91CD\u590D\u7684\u5143\u7D20\uFF0C\u82E5\u51FA\u73B0\u76F4\u63A5\u8FD4\u56DEfalse",paraId:195,tocIndex:43},{value:"\u7136\u540E\u53EF\u4EE5\u5148\u5BF9\u6570\u7EC4\u6392\u5E8F\uFF0C\u6392\u5E8F\u4E4B\u540E\u627E\u51FA \u6700\u5C0F\u3001\u6700\u5927\u7684\u503C",paraId:195,tocIndex:43},{value:"\u4E24\u8005\u4E4B\u5DEE\u5C0F\u4E8E5\u8BF4\u660E\u662F\u987A\u5B50",paraId:195,tocIndex:43},{value:`/**
 * @param {number[]} nums
 * @return {boolean}
 */
var isStraight = function (nums) {
    let joker = 0;
    nums.sort((a, b) => a - b);
    for (let i = 0; i < 4; i++) {
        if (nums[i] === 0) {
            joker++; // \u5927\u5C0F\u738B\u6570\u91CF
        } else if (nums[i] === nums[i + 1]) {
            // \u5224\u91CD
            return false;
        }
    }
    // [0,0,1,2,5]
    // 5-1<5
    // \u6700\u5927\u724C - \u6700\u5C0F\u724C < 5 \u5219\u53EF\u6784\u6210\u987A\u5B50
    return nums[4] - nums[joker] < 5;
};
