`,paraId:206,tocIndex:45},{value:"\u7B80\u5355\u7684\u8BF4\uFF0C\u5982\u679C",paraId:207,tocIndex:45},{value:"\u8981\u5411large\u63D2\u5165num\uFF0C\u8981\u5148\u628Anum\u63D2\u5165\u5230small\u4E2D\uFF0C\u7136\u540E\u5C06small\u7684\u5806\u9876\u5143\u7D20\u63D2\u5165large",paraId:207,tocIndex:45},{value:"\uFF0C\u63D2\u5165small\u65F6\u4E5F\u4E00\u6837",paraId:207,tocIndex:45},{value:"\u8FD9\u6837\u53EF\u4EE5\u4FDD\u8BC1\u4E24\u4E2A\u5806\u5B9A\u7684\u5143\u7D20\u5DEE\u5C0F\u4E8E\u7B49\u4E8E1",paraId:207,tocIndex:45},{value:"\u6700\u540E\u6839\u636E\u5947\u5076\u6027\u53BB\u8FD4\u56DE\u4E2D\u4F4D\u6570\u5373\u53EF",paraId:207,tocIndex:45},{value:"\u5982\u679C\u662F\u5947\u6570\uFF0C\u5C31\u5C06\u957F\u5EA6\u591A\u7684\u90A3\u4E2A\u5806\u7684\u5806\u9876\u5143\u7D20\u8FD4\u56DE",paraId:207,tocIndex:45},{value:"\u5982\u679C\u662F\u5076\u6570\uFF0C\u8BF4\u660E\u4E24\u4E2A\u5806\u7684\u5143\u7D20\u76F8\u7B49\uFF0C\u8FD4\u56DE\u4E24\u4E2A\u5806\u9876\u5143\u7D20\u7684\u5E73\u5747\u503C\u5373\u53EF",paraId:207,tocIndex:45},{value:"\u8DDF",paraId:207,tocIndex:45},{value:"295. \u6570\u636E\u6D41\u7684\u4E2D\u4F4D\u6570",paraId:208,tocIndex:45},{value:"\u76F8\u540C",paraId:207,tocIndex:45},{value:`/**
 * initialize your data structure here.
 */
var MedianFinder = function () {
    // \u4F18\u5148\u7EA7\u961F\u5217\uFF0Cleetcode\u5185\u7F6E\u4E86MaxPriorityQueue\u548CMinPriorityQueue
    // https://github.com/datastructures-js/priority-queue
    this.large = new MinPriorityQueue(); // large\u89E3\u91CA\uFF1A\u5E95\u90E8\u653E\u5927\u7684\uFF0C\u9876\u90E8\u662F\u5C0F\u7684\uFF0C\u8BF4\u4E00\u4F7F\u7528\u5C0F\u9876\u5806
    this.small = new MaxPriorityQueue();// small\u89E3\u91CA\uFF1A\u5E95\u90E8\u653E\u6700\u5C0F\uFF0C\u9876\u90E8\u662F\u5927\u7684\uFF0C\u6240\u4EE5\u4F7F\u7528\u5927\u9876\u5806
};

/**
 * @param {number} num
 * @return {void}
 */
MedianFinder.prototype.addNum = function (num) {
    if (this.small.size() >= this.large.size()) {
        this.small.enqueue(num);
        this.large.enqueue(this.small.dequeue()?.element);
    } else {
        this.large.enqueue(num);
        this.small.enqueue(this.large.dequeue()?.element);
    }
};

/**
 * @return {number}
 */
MedianFinder.prototype.findMedian = function () {
    const largeElement = this.large.front()?.element,
        smallElement = this.small.front()?.element;
    if (this.large.size() > this.small.size()) {
        // \u5982\u679Clarge\u7684\u6570\u91CF\u591A\uFF0C\u8FD4\u56DElarge\u7684\u5806\u9876\u5143\u7D20
        return largeElement;
    } else if (this.large.size() < this.small.size()) {
        // \u5982\u679Csmall\u7684\u6570\u91CF\u591A\uFF0C\u8FD4\u56DEsmall\u7684\u5806\u9876\u5143\u7D20
        return smallElement
    } else {
        // \u5982\u679C\u662F\u5076\u6570\uFF0Clarge\u548Csmall\u7684\u6570\u91CF\u76F8\u7B49\uFF0C\u5404\u53D6\u5806\u9876\u5143\u7D20\uFF0C\u6C42\u5E73\u5747\u503C
        return (largeElement + smallElement) / 2.0
    }
};

/**
 * Your MedianFinder object will be instantiated and called as such:
 * var obj = new MedianFinder()
 * obj.addNum(num)
 * var param_2 = obj.findMedian()
 */
