\u7A7A\u95F4\u590D\u6742\u5EA6\uFF1AO(1)`,paraId:14,tocIndex:3},{value:"\u601D\u8DEF\uFF08\u53CC\u6307\u9488\u6CD5\uFF09",paraId:15,tocIndex:3},{value:"\u5DE6\u53F3\u6307\u9488\uFF0C\u5411\u5185\u6ED1\u52A8",paraId:15,tocIndex:3},{value:"\u53D1\u73B0\u4E24\u4E2A\u6307\u9488\u7684\u503C\u76F8\u7B49\u65F6\uFF0C\u5DE6\u6307\u9488++\uFF0C\u53F3\u6307\u9488--\uFF0C\u5411\u5185\u9760\u62E2",paraId:15,tocIndex:3},{value:"\u8FB9\u754C\u503C\u60C5\u51B5\uFF1A",paraId:15,tocIndex:3},{value:"\u5F53\u8F93\u5165 1 \u4F4D\uFF0C\u7684\u65F6\u5019\uFF0C\u80AF\u5B9A\u662F\u56DE\u6587\u6570\uFF0Ctrue",paraId:15,tocIndex:3},{value:"\u5224\u65AD\u76F8\u7B49\u65F6\uFF0C\u6CE8\u610F\u503C\u4E0D\u80FD\u53D6\u7A7A\uFF0C\u5426\u5219\u4F1A\u4E0E undefined \u6BD4\u8F83",paraId:15,tocIndex:3},{value:"\u6700\u540E\u7ED3\u675F\u65F6\uFF0C\u5F53\u5934\u6307\u9488\u6CA1\u6709\u8D85\u8FC7\u4E2D\u4F4D\uFF0C\u8BF4\u660E\u4E0D\u662F\u56DE\u6587\u6570",paraId:15,tocIndex:3},{value:`/**
 * @param {number} x
 * @return {boolean}
 */
var isPalindrome = function (x) {
  const str = String(x);
  const len = str.length;
  if (len === 1) return true;
  let p1 = 0,
    p2 = len - 1;

  while (p1 < p2) {
    if (str[p1] !== str[p2]) return false;
    p1++;
    p2--;
  }
  return true;
};
