`,paraId:93,tocIndex:25},{value:"199.\u4E8C\u53C9\u6811\u7684\u53F3\u89C6\u56FE",paraId:0},{value:"medium",paraId:94,tocIndex:25},{value:"\u5C42\u5E8F\u904D\u5386\u65F6\uFF0C\u6BCF\u5C42\u7684\u6700\u540E\u4E00\u4E2A\u8282\u70B9\u5C31\u662F\u53F3\u89C6\u56FE\u7684\u8282\u70B9",paraId:95,tocIndex:26},{value:"\u4E3A\u4E86\u63D0\u9AD8\u6548\u7387\uFF0C\u4ECE\u53F3\u5411\u5DE6\u5C42\u5E8F\u904D\u5386\uFF0C\u6BCF\u5C42\u7B2C\u4E00\u4E2A\u8282\u70B9\u5C31\u662F\u53F3\u89C6\u56FE\u7684\u8282\u70B9",paraId:95,tocIndex:26},{value:`/**
 * @param {TreeNode} root
 * @return {number[]}
 */
var rightSideView = function (root) {
  const res = [];
  if (root === null) return res;
  const q = [root];

  while (q.length) {
    const rightView = q[0];
    for (let i = 0, len = q.length; i < len; i++) {
      let curNode = q.shift();
      curNode.right && q.push(curNode.right);
      curNode.left && q.push(curNode.left);
    }
    res.push(rightView.val);
  }
  return res;
};
