var checkValidString = function (s) {
  let left = [],
    start = [];

  for (let i = 0; i < s.length; i++) {
    const n = s[i];
    if (n === '(') {
      left.push(i);
    } else if (n === '*') {
      start.push(i);
    } else {
      if (left.length === 0) {
        if (start.length === 0) return false;
        start.pop();
      } else {
        left.pop();
      }
    }
  }

  if (left.length > start.length) return false;
  while (left.length && start.length) {
    if (left.pop() > start.pop()) return false;
  }
  return true;
};
